Leonard Nimoy - &quot;Lost&quot; 1967 TV Interview KGW-TV

A lost interview from 1967 conducted by KGW-TV, a news station in Portland, Oregon. This was rediscovered in 2010 in their film archives. Nimoy talks at length about playing Mr. Spock on &quot;Star Trek&quot;, then in its second season. Unfortunately, he does not shed any light on what compelled him to record &quot;The Ballad of Bilbo Baggins&quot;.

